# This is a sample config file.
# If your platform uses different versions, different
# hardware or operates in a different mode (for
# example, 32- vs. 64-bit mode), there is the possibiliy
# that this configuration file may not work as-is.
#
# Note that issues with compilation should be directed
# to the compiler vendor. Information about SPEC techncial
# support can be found in the techsupport document in the
# Docs directory of your benchmark installation.
#
# Also note that this is a sample configuration. It
# is expected to work for the environment in which
# it was tested; it is not guaranteed that this is
# the config file that will provide the best performance.
#
# Note that you might find a more recent config file for
# your platform with the posted results at
# www.spec.org/cpu2006
####################################################################

ignore_errors = yes
tune          = base
ext           = x86_64_linux
output_format = asc, pdf, Screen
reportable    = 0
teeout        = yes
teerunout     = yes
hw_avail = 
license_num =
test_sponsor = 
prepared_by = 
tester      =
test_date = 
strict_rundir_verify = 0

default=default=default=default:
#####################################################################
#
# Compiler selection
#
#####################################################################
CC           = clang
CXX          = clang++
FC           = flang-new

## HW config
hw_model     = AMD Ryzen Threadripper PRO 7995WX
hw_cpu_name  = AMD Ryzen Threadripper PRO 7995WX
hw_cpu_char  =
hw_cpu_mhz   = 2496.249
hw_fpu       = yes
hw_nchips	= 1
hw_ncores	= 128
hw_ncoresperchip= 1
hw_nthreadspercore = 1
hw_ncpuorder = 1 chip
hw_tcache    = None
hw_ocache    = None
hw_memory	= 512 GB 
hw_disk		= SSD
hw_vendor	= 

## SW config
sw_os        = 
sw_file      = 
sw_state     = 
sw_compiler  = clang , clang++ & flang-new
sw_avail = Dec-9999
sw_other = None
sw_auto_parallel = No
sw_base_ptrsize = 64-bit
sw_peak_ptrsize = Not Applicable

use_submit_for_speed = 1
submit = numactl -m 0 --physcpubind=12 $command


#####################################################################
# Optimization
#####################################################################
## Base is low opt
default=base=default=default:
COPTIMIZE     = -std=gnu89 -w  -O3 -Wno-int-conversion  -flto -fuse-ld=lld   -ffast-math -funroll-loops -ftree-vectorize -fprefetch-loop-arrays
CXXOPTIMIZE  = -std=c++03 -w -O3 -Wno-int-conversion  -flto -fuse-ld=lld  -ffast-math -funroll-loops  -ftree-vectorize -fprefetch-loop-arrays
FOPTIMIZE    = -O3 -ffast-math

notes0100= C base flags: $[COPTIMIZE]
notes0110= C++ base flags: $[CXXOPTIMIZE]
notes0120= Fortran base flags: $[FOPTIMIZE]

#####################################################################
# 32/64 bit Portability Flags - all
#####################################################################

default=base=default=default:
notes25= PORTABILITY=-DSPEC_CPU_LP64 is applied to all benchmarks in base.
PORTABILITY = -DSPEC_CPU_LP64

# #####################################################################
# # Portability Flags - INT
# #####################################################################
400.perlbench=default=default=default:
notes35    = 400.perlbench: -DSPEC_CPU_LINUX_X64
CPORTABILITY= -DSPEC_CPU_LINUX_X64 -include math.h

462.libquantum=default=default=default:
notes60= 462.libquantum: -DSPEC_CPU_LINUX
CPORTABILITY= -DSPEC_CPU_LINUX

# 416.gamess=default=default=default:
# #FOPTIMIZE=-O1 -march=native 
# FPORTABILITY = -std=legacy -fno-aggressive-loop-optimizations   -fdelete-dead-exceptions                                  


483.xalancbmk=default=default=default:
CXXPORTABILITY= -DSPEC_CPU_LINUX -include cstdlib -include cstring

